alter table cur_assets_package_temp add COLUMN dzhxrq date DEFAULT NULL COMMENT '呆账核销日期';
alter table cur_assets_package add COLUMN dzhxrq date DEFAULT NULL COMMENT '呆账核销日期';

drop table if exists certificate_config;
CREATE TABLE `certificate_config` (
	`id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `cid` int(11) NOT NULL COMMENT '编号',
  `name` varchar(64) DEFAULT NULL COMMENT '省/市名称',
  `pid` int(11) DEFAULT 0 COMMENT '父编号',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
alter table certificate_config comment '证件号码配置表';

